package leetcode

import "testing"

func TestValidPalindrome(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{"test01",args{"abca"},true},
		{"test02",args{""},true},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := ValidPalindrome(tt.args.s); got != tt.want {
				t.Errorf("ValidPalindrome() = %v, want %v", got, tt.want)
			}
		})
	}
}

func BenchmarkValidPalindrome(b *testing.B) {
	s := "abca"
	b.ResetTimer()
	for i:=0;i<b.N ;i++  {
		ValidPalindrome(s)
	}
}

func BenchmarkValidPalindromeX(b *testing.B) {
	s := "abca"
	b.ResetTimer()
	for i:=0;i<b.N ;i++  {
		ValidPalindromeX(s)
	}
}

